column25:
Casa possui Habite-se, totalmente plana(linear) e com rampas de acesso a áreas externas.
 Área Externa com horta, muitas árvores frutíferas(Ingá, manga, mamão, sapoti, abacaxi, ameixa, graviola, mexerica, amora, maçã, banana, maracujá, fruta do conde, jabuticaba;
 Coletores para água da chuva com sistema de irrigação para as plantas;
 Engenho de cana;
 Fornalha;
 Moinho de fubá;
 Edícula com 2 quartos e banheiro;
